INSERT INTO `answer_options` (`id`, `text`, `question_id`, `is_right`, `deleted_at`) VALUES
(1, 'Тугара Вовка і ще в такій невеличкій.', 1, 1, '2020-04-25 06:15:38'),
(2, 'Максима, не зводячи з нього живу.', 1, 0, '2020-04-25 06:15:38'),
(3, 'Зелеменя і відсунені від нього на.', 1, 0, '2020-04-25 06:15:38'),
(4, 'Звір заревів ще дужче погіршить. - А.', 2, 1, '2020-04-25 06:15:38'),
(5, 'За остінком - куснем недобудованого.', 2, 0, '2020-04-25 06:15:38'),
(6, 'Рад побачити того, хто приступить до.', 3, 1, NULL),
(7, 'Чи так роблять чесні громадяни?.', 3, 0, NULL),
(8, 'Ні, таточку, не говори сього! Не своєї.', 3, 0, NULL),
(9, 'Се новий тухольський боярин, Тугар.', 3, 0, NULL),
(10, 'Кожда громада висилала по.', 3, 1, NULL),
(11, 'Для того Максим крикнув до своїх.', 4, 1, NULL),
(12, 'Він біг зразу на тих, що дісталися до.', 4, 1, NULL),
(13, 'Але галицько-руським князям вона з.', 4, 1, NULL),
(14, 'І певно, що круто прийшлось би було.', 5, 1, NULL),
(15, 'Мирославу; вона зблідла і позирала то.', 5, 1, NULL),
(16, 'Володар Червоної Русі, через.', 6, 1, NULL),
(17, 'Широкою рікою плили по Русі пожежі.', 6, 0, NULL),
(18, 'Він безмірно переви-щав Пету своєю.', 6, 0, NULL),
(19, 'Сумно похилили голови тустанські.', 7, 1, NULL),
(20, 'Коли він стає для інших тягарем, а.', 7, 0, NULL),
(21, 'Луна покотилася полонинами.', 7, 1, NULL),
(22, 'Ти поглянь на себе! Може, до тебе така.', 7, 0, NULL),
(23, 'Максима. Але Максим цілком не змішався.', 7, 1, NULL),
(24, 'Бачачи по долах, як князі та бояри.', 8, 1, NULL),
(25, 'Максима. З трудом видряпався сюди.', 8, 1, NULL),
(26, 'Мирослава ще вагувалась. Але, втім.', 8, 0, NULL),
(27, 'В кровавім розблиску огнів виднілися.', 8, 1, NULL),
(28, 'Вдасть боярська не могла нічого.', 8, 1, NULL),
(29, 'ІІостій, боярине, я ще не надійшли, а.', 9, 1, NULL),
(30, 'Ну, рад я побачити, чи твої Беркути.', 9, 1, NULL),
(31, 'Але боярина не - лякаємось. Вона може.', 9, 0, NULL),
(32, 'Але руки їх мимоволі вхопили за.', 9, 1, NULL),
(33, 'Може, їхати до Галича, до князя.', 9, 1, NULL),
(34, 'Чінгісхана, а його кусень заліза.', 10, 1, NULL),
(35, 'Але проте Максим не відпирався від.', 10, 0, NULL),
(36, 'Максим Беркут велів товариству на.', 10, 0, NULL),
(37, 'О ні! Коли б не ми, то ви, певно, мов.', 11, 1, NULL),
(38, 'Вовк, - обертаючись лицем до монголів.', 11, 0, NULL),
(39, 'Се був страшний, безтямно смілий і.', 11, 0, NULL),
(40, 'Тугара Вовка і ще в тій боротьбі.', 12, 1, NULL),
(41, 'У смертельній тривозі, яка й.', 12, 0, NULL),
(42, 'Аж наближуючись до монголів, стрічені.', 12, 1, NULL),
(43, 'Богу дякувати, що й сусіднє місце буде.', 13, 1, NULL),
(44, 'В отсих горах - живе один дід, що його.', 13, 0, NULL),
(45, 'Мирослава стала на той голос і перший.', 13, 1, NULL),
(46, 'Ти закидаєш мені, що ви хотіли би.', 13, 0, NULL),
(47, 'Що ж,сказав він,дурна звірюка той.', 14, 1, NULL),
(48, 'Бідний Максим! Він старався в інших.', 14, 0, NULL),
(49, 'І, як стій, Захар Беркут уже в своїм.', 14, 1, NULL),
(50, 'Коли було настане час між зеленими.', 14, 1, NULL),
(51, 'А втім, надлетіла монгольська погоня.', 15, 1, NULL),
(52, 'Максима довго здержувані сльози, що.', 15, 0, NULL),
(53, 'Мовчи, підлий рабе! скрикнув.', 15, 0, NULL),
(54, 'Але найбільше змінилися люди. Зверха.', 15, 1, NULL),
(55, 'Але в чім тухольців і не могла нічого.', 15, 1, NULL),
(56, 'Захар Беркут і наважився відбути його.', 16, 1, NULL),
(57, 'Тухля була оселя не дуже давня, і.', 16, 0, NULL),
(58, 'Але ніщо було й думати, тим більше.', 17, 1, NULL),
(59, 'Правда, в тім яка зрада? Чи не.', 17, 1, NULL),
(60, 'Максимова, через тебе не можу слухати.', 17, 1, NULL),
(61, 'Не знати, про що думав він, але його.', 18, 1, NULL),
(62, 'Тугар Вовк ставав чимраз більше.', 18, 0, NULL),
(63, 'Чінгісхана не міг здобутися на один.', 19, 1, NULL),
(64, 'Сам иачиш і знаєш, що вітця й опікуна.', 19, 0, NULL),
(65, 'Захар Беркут - се була величезна.', 19, 1, NULL),
(66, 'Максим, і без умілості - воєнної. Тим.', 19, 1, NULL),
(67, 'Захарові слова. - Ей, громадяни.', 19, 1, NULL),
(68, 'В кровавім розблиску огнів виднілися.', 20, 1, NULL),
(69, 'Тугар Вовк побачив свою помилку і.', 20, 1, NULL),
(70, 'Не в пориві дикої - пристрасті, не без.', 20, 1, NULL),
(71, 'Може, годину йшло товариство тою.', 20, 0, NULL),
(72, 'Від віків ми вживали їх аж тоді, коли.', 20, 1, NULL),
(73, 'Ось устав один із того гнізда, а на.', 21, 1, NULL),
(74, 'Знаю,відповів твердим голосом Митько.В.', 21, 0, NULL),
(75, 'І «проганяєш наших пастухів, убиваєш.', 21, 1, NULL),
(76, 'А довга дорога тухольським шляхом до.', 22, 1, NULL),
(77, 'Хоч і як тяжко приходилось йому, але.', 22, 0, NULL),
(78, 'Захарові слова. - Вигнали нас.', 23, 1, NULL),
(79, 'Упав, підступно повалений, Максим, і.', 23, 0, NULL),
(80, 'В щілині кам\'яних звалищ понад головою.', 23, 1, NULL),
(81, 'Тільки така суцільність і свобода.', 24, 1, NULL),
(82, 'Захар розу^ мів добре, що й сусіднє.', 24, 1, NULL),
(83, 'Тільки невеличка горстка найсильніших.', 24, 1, NULL),
(84, 'Пета. - Другий шлях.', 24, 0, NULL),
(85, 'Звір, побачивши блискуче залізне.', 25, 1, NULL),
(86, 'А товариші гнали слідом за ними.', 25, 1, NULL),
(87, 'Шумно збиралася мо-лодіж і ставала.', 25, 0, NULL),
(88, 'Наші пішоходи були саме серед села і.', 26, 1, NULL),
(89, 'Не вернемось? А се для чого? - Для.', 26, 1, NULL),
(90, 'Ось уже прийшли на місце. Медведяче.', 26, 1, NULL),
(91, 'Сонце, невже ж ти не знаєш, що вітця й.', 27, 1, NULL),
(92, 'А обік зроблене було друге підвищення.', 27, 1, NULL),
(93, 'Що значить присяга дурної, осліпленої.', 28, 1, NULL),
(94, 'Нема за що ж то я не дурна і не так.', 28, 0, NULL),
(95, 'Максима - наскрізь. Але слова не було.', 28, 1, NULL),
(96, 'Все те згадала тепер в нашій.', 28, 0, NULL),
(97, 'Максима не видно, а перед другими.', 29, 1, NULL),
(98, 'Вони сміялись тепер зі своїми слугами.', 29, 1, NULL),
(99, 'Ніякі Максимові докази про трудності.', 29, 1, NULL),
(100, 'Моравської і з горляною, співучою.', 29, 1, NULL),
(101, 'Уважайте ж, чесна громадо! Злодійські.', 29, 1, NULL),
(102, 'Там, на шляху, що вів від села попри.', 30, 1, NULL),
(103, 'Люди, мов мурашки, снували поміж.', 30, 0, NULL),
(104, 'Прийди завтра на тоту раду, бо вони.', 30, 1, NULL),
(105, 'А тим часом дати трубою тривожний знак.', 30, 1, NULL),
(106, 'Тугара, щоб помститись - смерті.', 31, 1, NULL),
(107, 'І ти думав, що, рятуючи її - читати, а.', 31, 0, NULL),
(108, 'Говори, брате Бурундо! сказав Пета.', 31, 1, NULL),
(109, 'І справді, план Бурунди був хоч і його.', 31, 1, NULL),
(110, 'Тугар Вовк при його словах і розказах.', 32, 1, NULL),
(111, 'Батько її - від себе широкими.', 32, 1, NULL),
(112, 'До зброї, браття, до зброї! Монголи!.', 33, 1, NULL),
(113, 'Всі стали мов мертві, безладна сумішка.', 33, 0, NULL),
(114, 'Він, Митько, також був у кождого лук і.', 33, 1, NULL),
(115, 'Адже ж кождий із них не було таке.', 33, 1, NULL),
(116, 'А ти хочеш з монголами напасти на.', 33, 1, NULL),
(117, 'Ну, що, може, їхати най до нього.', 34, 1, NULL),
(118, 'Від самого досвіта в ловецькім таборі.', 34, 1, NULL),
(119, 'Максима не видно, а перед другими.', 34, 1, NULL),
(120, 'Але все- таки його стережено чуйно.', 34, 1, NULL),
(121, 'А тепер прощай. Він вийшов, і заслона.', 35, 1, NULL),
(122, 'Ні, не на смерть. Сьо-\'-о було вже.', 35, 1, NULL),
(123, 'Червоній Русі, йде блискавкою вість.', 36, 1, NULL),
(124, 'Я беру тільки те, що мені мститися на.', 36, 1, NULL),
(125, 'Так, так, ударимо на монголів!.', 36, 1, NULL),
(126, 'І хоч мед пінився в точених дерев\'яних.', 36, 1, NULL),
(127, 'І ліси, і села, і тільки через верх.', 37, 1, NULL),
(128, 'А тим часом починав собі все згорда.', 37, 1, NULL),
(129, 'Звір сунув чимраз ближче: гарячий його.', 37, 1, NULL),
(130, 'Нинішній, остатній, день ловів мав.', 38, 1, NULL),
(131, 'Навіть коні під нашими їздцями почали.', 38, 1, NULL),
(132, 'Одного дня прибігли до Тухлі день.', 38, 0, NULL),
(133, 'Довго блукав він по селах більше, але.', 38, 0, NULL),
(134, 'Так, справді, се була величезна.', 38, 1, NULL),
(135, 'Опором, віддалік від Тухлі, але на.', 39, 1, NULL),
(136, 'Тільки невеличка горстка найсильніших.', 39, 1, NULL),
(137, 'Ніхто не відзивався на ті Захарові.', 39, 1, NULL),
(138, 'В щілині кам\'яних звалищ понад головою.', 39, 1, NULL),
(139, 'Захара Беркута. А при тім прості слова.', 40, 1, NULL),
(140, 'Треба використати - його, спасу його.', 40, 1, NULL),
(141, 'Максим виразно казав, що їдемо до.', 40, 0, NULL),
(142, 'Мирослави, лише глядів і глядів у.', 40, 1, NULL),
(143, 'Для другів наших ми гостинні,сказав.', 40, 1, NULL),
(144, 'це спеціальна конструкція, яка використовується для групування пов\'язаних змінних та функцій.', 1, 1, NULL),
(145, 'це функція, що дає змогу отримати значення глобальних змінних.', 1, 0, NULL),
(146, 'це макет, по якому можна створювати об\'єкти.', 1, 1, NULL),
(147, 'Лише 1', 2, 0, NULL),
(148, 'Скільки потрібно', 2, 1, NULL);
