(4, 'Серце твоє пробудиться і заговорить. «Слухай свого серця?', 2, NULL),
(5, 'Тим ліпше!» - говорила вона з таким солодким усміхом, що?', 6, NULL),
(6, 'Ми готові дати вам поміч, якої - зажадаєте,і хлібом, і?', 5, NULL),
(7, 'Чи то для нас земля й ліс. Від віків ми вживали їх аж?', 3, NULL),
(8, 'А тим часом починав собі все те запалювало його гарячу?', 2, NULL),
(9, 'Сонце піднялось уже високо на небі, коли з села, остатні?', 5, NULL),
(10, 'Такої рани замовити не можна. Шлях наш при вашій помочі?', 4, NULL),
(11, 'При вході в долину зовсім не вдоволила й не диво, що під?', 4, NULL),
(12, 'А може, йому удасться як-небудь потішити її, злагодити?', 2, NULL),
(13, 'Їдовитий голос боярина стався при кінці якимсь м\'яким?', 2, NULL),
(14, 'Велика часть громадян пристала на се, і певно, що круто?', 3, NULL),
(15, 'Щоб одному надати велику власть над народом, треба кождій?', 4, NULL),
(16, 'Озеро було під опікою Морани, богині смерті. Але раз?', 6, NULL),
(17, 'Тухольщина, наш рай! сказав Максим, обтираючи о кожух?', 5, NULL),
(18, 'А що ж то я не лишусь! - Лишись! Богом клянусь тобі, що не?', 3, NULL),
(19, 'Там мої товариші лишаться - пильнувати виходу, щоб ані?', 4, NULL),
(20, 'В пору приходиш,сказав Пета,ми дожидали свого союзника?', 2, NULL),
(21, 'Захар утих на хвилю. Його бесіда зробила велике враження?', 6, NULL),
(22, 'Максимом; решта товариства ступала за ними головна сила?', 6, NULL),
(23, 'Мирослава вхопилась за груди і відвернула очі. Тухольські?', 2, NULL),
(24, 'Ніхто не затямив, коли її засаджено і коли вона розрослася?', 5, NULL),
(25, 'Тухольщина, наш рай! сказав Максим, обкидаючи оком долину?', 6, NULL),
(26, 'В тій хвилі зробили те саме. Боярська служба, хоч далеко?', 3, NULL),
(27, 'Русі. Горе громаді, котра добровільно станеться тою раною?', 6, NULL),
(28, 'В одній хвилі зробили те саме. - Чесна громадо,сказав?', 2, NULL),
(29, 'Князь один вільний, а ми його - проводом кинулася бігцем?', 6, NULL),
(30, 'Грім з ясного неба не був в силі спасти їх. Мов розгу-кана?', 6, NULL),
(31, 'А неприхильний засуд, що вирече прогнання боярина з?', 6, NULL),
(32, 'І хоча в цілій розмові ані одним рухом зі свого пальця?', 2, NULL),
(33, 'Раптом медведиця вхопила в передні лапи великий камінь і?', 6, NULL),
(34, 'І чим більші трудності їй прихопилось поборювати, тим?', 2, NULL),
(35, 'Довгий час прожив ти на світі, хоч тут же перед собою?', 3, NULL),
(36, 'Всі стали мов мертві, безладна сумішка - перемінилася на?', 5, NULL),
(37, 'Він біг зразу на чотирьох жердках, зв\'заних угорі докупи?', 3, NULL),
(38, 'Не диво, проте, що, лежачи при тій нагоді він побачить її!?', 6, NULL),
(39, 'З пропадистих, чорних, мов горла безодні, дебрів?', 5, NULL),
(40, 'Боярин лютився на своїм становищі, якраз о яких десять?', 6, NULL);
